import React from "react";
import {NavLink} from 'react-router-dom';

function Nav(){
    return (
        <div className="nav-bar">
            <img src="https://acing.net/wp-content/uploads/2020/09/Ingredient-Resources.jpg"/>
            <NavLink
            to="/"
            exact
            className="nav-links"
            >
                Home
            </NavLink>
            <NavLink className="nav-links" to="/recipes">View All of Our Recipes</NavLink>
            <NavLink className="nav-links" to="/recipeform">Add Your Own Recipe</NavLink>
        </div>
    )
}

export default Nav;
